import React from "react";
import {Router} from "react"
import { render } from "@testing-library/react";
import Home from "./containers/Home";

function App (){
    return (
        <>
        <Router>
            <Route path="/" component={Home}/>
        </Router>
        </>
    )
}

export default App;
